import nodemailer from 'nodemailer';

const emailUser = process.env.REACT_APP_EMAIL_USER
const emailHost = process.env.REACT_APP_EMAIL_HOST
const emailPort = process.env.REACT_APP_EMAIL_PORT
const emailPass = process.env.REACT_APP_EMAIL_PASS

const transporter = nodemailer.createTransport({
    host: emailHost,
    port: emailPort,
    auth: {
        user: emailUser,
        pass: emailPass
    }
});

export default transporter;
